import React from 'react';
import image from "../public/fashion.jpeg"
import styled from 'styled-components';
const GridWrapper = styled.div`
  display: grid;
  grid-gap: 10px;
  margin-top: 1em;
  margin-left: 270px;
  margin-right: 6em;
  grid-template-columns: repeat(12, 1fr);
  grid-auto-rows: minmax(25px, auto);
`;
export const Home = (props) => (
  <GridWrapper>
    <div class="container">
      <div class="row">
        <div class="col-lg-4">
          <img src={require('public/fashion.jpeg')} width="100%" />
        </div>
        <div class="col-lg-8">

        </div>
      </div>
    </div>
    
  </GridWrapper>
)
